import React from "react";
import "./Table.scss";
const table = ({ data, headers }) => {
  let row = data.map((row, i) => (
    <tr className="row">
      {Object.keys(row).map((item, i) => (
        <td key={i}>{row[item]}</td>
      ))}
    </tr>
  ));
  console.log(row);
  if (row.length === 0) {
    console.log("yea");
    row = (
      <tr>
        <td></td>
        <td>
          <h2 style={{ margin: "auto" }}>No Records</h2>;
        </td>
        <td></td>
      </tr>
    );
  }

  return (
    <div className="table">
      <h2>Frequently Requested Materials</h2>
      <table className="content-table">
        <thead>
          <tr className="bg-primary">
            {headers.map((title) => (
              <th key={title}>{title}</th>
            ))}
          </tr>
        </thead>
        <tbody>{row}</tbody>
      </table>
      <h2 style={{ margin: "auto" }}>No Records</h2>;
    </div>
  );
};

export default table;
